import axios from 'axios';

let url = "http://localhost:3000";

const instance = axios.create({
     baseURL: 'https://some-domain.com/api/',
  timeout: 1000,
});

async function getItems() {
    items = await axios.get(url+"/items");
    return items;
}

export { getItems };
